import React from 'react';

const LiftLog = () => {
  return (
    <div id="lift-log">
      <LiftSelector />
    </div>
  );
}

const LiftSelector = () => {
  return (
    <div id="lift-selector">
        lift Selector
    </div>
  );
}

export default LiftLog;
